	.apply-refund-container {
		.toptip {
			width: 100%;
			padding: 10upx 40upx;
			background-color: #fff4de;
			color: #e2a509;
			font-size: 26upx;
			// line-height: 40upx;
			// height: 40upx;
			display: flex;
			align-items: center;
			justify-content: center;
		}

		.refundable-refund {
			font-size: 28upx;
			color: #666666;
		}

		.refund-price {
			font-size: 30upx;
			color: #fc322e;
			font-weight: 700;
			margin-left: 40upx;
		}

		.items {

			width: 100%;
			padding: 20upx 40upx;

			background-color: #fff;

			.title {
				font-size: 34upx;
				height: 85upx;
				line-height: 85upx;
			}

			.item {
				height: 75upx;
				line-height: 75upx;
				border-top: 1px solid #f3f4f6;
				display: flex;
				align-items: center;

				.text {
					font-size: 28upx;

					.itemRemarks {
						font-size: 26upx;
						color: #fd871f;
						padding-left: 60upx;
					}
					.paddingleft10{
						padding-left: 10upx;
					}
				}

				.item-img {
					width: 30upx;
					height: 30upx;
					background-color: #fb8519;
					border-radius: 50upx;
					display: flex;
					justify-content: center;
					align-items: center;

					image {
						width: 80%;
						height: 80%;

					}
				}

				.item-img-no {
					width: 30upx;
					height: 30upx;
					border-radius: 50upx;
					border: 1px solid #c6c6c6;

				}
			}
		}

		.refund-top {
			padding: 0 40upx;
			line-height: 90upx;
		}

		.refund-info {
			padding: 40upx;

			.refund-img {
				width: 190upx;
				height: 110upx;
				// background-color: skyblue;
			}

			.refund-right {
				padding-left: 10upx;
			}
		}



		.page-bottom {
			height: 50upx;
		}

		.textarea-box {
			font-size: 28upx;
			padding: 30upx 20upx;

			.refund-textarea {
				background-color: #f3f4f6;
				border-radius: 15upx;
				width: 90%;
				margin: 0 auto;
				height: 230upx;
				padding-bottom: 30upx;
			}

			.right-bottom-text {
				position: absolute;
				right: 69rpx;
				bottom: 7rpx;
				font-size: 28rpx;
				color: #333;
			}
		}
	}


